:{}}','{\"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(2,'query','SELECT\n  Country,\n  Rank2015 AS [2015],\n  Rank2016 AS [2016],\n  Rank2017 AS [2017],\n  Rank2018 AS [2018],\n  Rank2019 AS [2019]\nFROM\n  world_happiness_ranking_2015_to_2019\nWHERE Region = \"{{Region}}\";\n-- Region is a template variable with the value of \'Western Europe\'\n-- click on the <> button on the bottom right of the DataDoc to configure more!\n    ','{\"title\": \"Western Europe Countries Ranking\", \"engine\": 1}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(3,'text','{\"blocks\":[{\"key\":\"ahup0\",\"text\":\"Chart Cell: Line Graph\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"tlat\",\"text\":\"The settings on the chart below has been pre-set to display the results from the query cell above.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"vnl1\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"at9lo\",\"text\":\"Hover over the chart to see the values in the tooltip.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}','{\"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(4,'chart','','{\"data\": {\"source_type\": \"cell_above\", \"transformations\": {\"format\": {}, \"switch\": true, \"aggregate\": false}}, \"chart\": {\"type\": \"line\", \"x_axis\": {\"sort\": {\"asc\": true, \"idx\": 0}, \"label\": \"Year\", \"col_idx\": 0}, \"y_axis\": {\"label\": \"Rank\", \"stack\": false, \"series\": {\"0\": {\"agg_type\": \"sum\"}, \"1\": {\"agg_type\": \"sum\"}, \"2\": {\"agg_type\": \"sum\"}, \"3\": {\"agg_type\": \"sum\"}, \"4\": {\"agg_type\": \"sum\"}, \"5\": {\"agg_type\": \"sum\"}, \"6\": {\"agg_type\": \"sum\"}, \"7\": {\"agg_type\": \"sum\"}, \"8\": {\"agg_type\": \"sum\"}, \"9\": {\"agg_type\": \"sum\"}, \"10\": {\"agg_type\": \"sum\"}, \"11\": {\"agg_type\": \"sum\"}, \"12\": {\"agg_type\": \"sum\"}, \"13\": {\"agg_type\": \"sum\"}, \"14\": {\"agg_type\": \"sum\"}, \"15\": {\"agg_type\": \"sum\"}, \"16\": {\"agg_type\": \"sum\"}, \"17\": {\"agg_type\": \"sum\"}, \"18\": {\"agg_type\": \"sum\"}, \"19\": {\"agg_type\": \"sum\"}, \"20\": {\"agg_type\": \"sum\"}}}}, \"title\": \"Western Europe Countries Ranking\", \"visual\": {\"legend_position\": \"top\"}, \"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(5,'text','{\"blocks\":[{\"key\":\"4pmfj\",\"text\":\"Query Cell\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"9c5lj\",\"text\":\"Here is another query for you to run!\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cooab\",\"text\":\"The results can be shared with other users or exported.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"7nfpk\",\"text\":\"Check out the controls on the bottom right of the Query Editor.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}','{\"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(6,'query','SELECT\n    Country,\n    GDP,\n    SocialSupport,\n    HealthyLifeExpectancy,\n    FreedomToMakeLifeChoices,\n    Generosity,\n    PerceptionsOfCorruption\nFROM\n    world_happiness_2019\nLIMIT\n    10;\n    ','{\"title\": \"2019 Top 10 Countries\", \"engine\": 1}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(7,'text','{\"blocks\":[{\"key\":\"asdka\",\"text\":\"Chart Cell: Bar Charts\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"1k6fm\",\"text\":\"You can title, label, and configure the chart to display the results in an easy-to-understand manner.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"86fav\",\"text\":\"Click on `CONFIG CHART` to see the chart settings & explore.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}','{\"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(8,'chart','','{\"data\": {\"source_type\": \"cell_above\", \"transformations\": {\"format\": {}, \"switch\": true, \"aggregate\": false}}, \"chart\": {\"type\": \"bar\", \"x_axis\": {\"label\": \"Categories\", \"col_idx\": 0}, \"y_axis\": {\"label\": \"Score\", \"stack\": false, \"series\": {\"0\": {\"agg_type\": \"sum\"}, \"1\": {\"agg_type\": \"sum\"}, \"2\": {\"agg_type\": \"sum\"}, \"3\": {\"agg_type\": \"sum\"}, \"4\": {\"agg_type\": \"sum\"}, \"5\": {\"agg_type\": \"sum\"}, \"6\": {\"agg_type\": \"sum\"}, \"7\": {\"agg_type\": \"sum\"}, \"8\": {\"agg_type\": \"sum\"}, \"9\": {\"agg_type\": \"sum\"}, \"10\": {\"agg_type\": \"sum\"}}}}, \"title\": \"2019 Top 10 Countries\", \"visual\": {\"legend_position\": \"top\"}, \"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(9,'text','{\"blocks\":[{\"key\":\"cbs69\",\"text\":\"Query Cell\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"5ajp\",\"text\":\"The query cell below has been collapsed. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"bvfr2\",\"text\":\"Query cells can be collapsed in order to make DataDocs easier to view.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"2d2q7\",\"text\":\"\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"f24oq\",\"text\":\"Hover over the title Top 10 Countries Score to see the cell management buttons.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":21,\"length\":22,\"style\":\"ITALIC\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"4kip1\",\"text\":\"Click on the dropdown button on the top left or on the cell itself to uncollapse the cell and run the query. \",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[{\"offset\":48,\"length\":11,\"style\":\"BOLD\"}],\"entityRanges\":[],\"data\":{}},{\"key\":\"c0c7\",\"text\":\"You can click on the lock button that appears next to the dropdown button to change the default setting of the cell when the DataDoc loads.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}','{\"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(10,'query','{% macro query(year) %}\n{% set rank = \'Rank\' if year > 2017 else \'HappinessRank\' %}\n{% set score = \'Score\' if year > 2017 else \'HappinessScore as Score\' %}\nSELECT\n  *\nFROM(\n    SELECT\n      \'{{ year }}\' AS Year,\n      Country,\n      {{ score }}\n    FROM\n      world_happiness_{{year}}\n    ORDER BY\n      {{ rank }}\n    LIMIT\n      10\n  )\n{%- endmacro %}\n{% for i in [2019, 2018, 2017, 2016, 2015] %}\n  {% if loop.index0 != 0 %}\n    UNION\n  {% endif %}\n  {{ query(i) }}\n{% endfor %}\nORDER BY\nScore DESC;\n  -- This is another example of templating!\n  -- Check out: https://jinja.palletsprojects.com/en/2.11.x/templates/\n  --    for more usages and information!','{\"title\": \"Top 10 Countries Score\", \"engine\": 1, \"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(11,'text','{\"blocks\":[{\"key\":\"ds1ln\",\"text\":\"Chart Cells: Multiple Charts from Results\",\"type\":\"header-two\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"3opak\",\"text\":\"The results from a query cell can be manipulated to visualize the data in different ways.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"cnu9f\",\"text\":\"Below are two examples of the same data.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}},{\"key\":\"anuvc\",\"text\":\"Check out the configurations to see how the data was transformed.\",\"type\":\"unstyled\",\"depth\":0,\"inlineStyleRanges\":[],\"entityRanges\":[],\"data\":{}}],\"entityMap\":{}}','{\"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(12,'chart','','{\"data\": {\"source_type\": \"cell_above\", \"transformations\": {\"format\": {\"agg_col\": 1, \"series_col\": 0, \"value_cols\": [2]}, \"switch\": false, \"aggregate\": true}}, \"chart\": {\"type\": \"bar\", \"x_axis\": {\"label\": \"Country\", \"col_idx\": 0}, \"y_axis\": {\"label\": \"Happiness Score\", \"stack\": false, \"series\": {\"0\": {\"agg_type\": \"sum\"}, \"1\": {\"color\": 1, \"agg_type\": \"sum\"}, \"2\": {\"color\": 5, \"agg_type\": \"sum\"}, \"3\": {\"agg_type\": \"sum\"}, \"4\": {\"color\": 6, \"agg_type\": \"sum\"}, \"5\": {\"color\": 9, \"agg_type\": \"sum\"}}}}, \"title\": \"Top 10 Countries Score\", \"visual\": {\"legend_position\": \"top\"}, \"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(13,'chart','','{\"data\": {\"source_type\": \"cell_above\", \"transformations\": {\"format\": {\"agg_col\": 0, \"series_col\": 1, \"value_cols\": [2]}, \"switch\": false, \"aggregate\": true}}, \"chart\": {\"type\": \"histogram\", \"x_axis\": {\"label\": \"Year\", \"col_idx\": 0}, \"y_axis\": {\"label\": \"Happiness Score\", \"stack\": false, \"series\": {\"0\": {\"agg_type\": \"sum\"}, \"1\": {\"color\": 12, \"agg_type\": \"sum\"}, \"2\": {\"color\": 5, \"agg_type\": \"sum\"}, \"3\": {\"color\": 14, \"agg_type\": \"sum\"}, \"4\": {\"color\": 3, \"agg_type\": \"sum\"}, \"5\": {\"color\": 13, \"agg_type\": \"sum\"}, \"6\": {\"color\": 6, \"agg_type\": \"sum\"}, \"7\": {\"color\": 9, \"agg_type\": \"sum\"}, \"8\": {\"color\": 0, \"agg_type\": \"sum\"}, \"9\": {\"color\": 4, \"agg_type\": \"sum\"}, \"10\": {\"color\": 11, \"agg_type\": \"sum\"}, \"11\": {\"color\": 2, \"agg_type\": \"sum\"}}}}, \"title\": \"Top 10 Countries Score\", \"visual\": {\"legend_position\": \"top\"}, \"collapsed\": false}','2025-03-08 20:58:59','2025-03-08 20:58:59'),(14,'query','\nWITH TransactionSummary AS (\n    SELECT \n        bank_transactions.\"CustLocation\" AS identifier,  -- Lowercase column name\n        COUNT(bank_transactions.\"TransactionID\") AS total_transactions,\n        AVG(\"TransactionAmount (INR)\") AS avg_transaction_amount,  -- Use underscore\n        SUM(\"TransactionAmount (INR)\") AS total_transaction_amount\n    FROM public.bank_transactions\n    GROUP BY \"CustLocation\"\n),\nCustomerSegmentation AS (\n    SELECT \n        bank_transactions.\"CustomerID\" AS identifier,\n        CASE \n            WHEN bank_transactions.\"CustAccountBalance\" < 5000 THEN \'Low Balance\'\n            WHEN bank_transactions.\"CustAccountBalance\" BETWEEN 5000 AND 50000 THEN \'Medium Balance\'\n            ELSE \'High Balance\'\n        END AS account_segment\n    FROM public.bank_transactions\n)\nSELECT \n    identifier,\n    total_transactions,\n    avg_transaction_amount,\n    total_transaction_amount\nFROM TransactionSummary \nUNION ALL\nSELECT \n    identifier,\n    NULL::INTEGER,\n    NULL::REAL,\n    NULL::REAL\nFROM CustomerSegmentation LIMIT 10;\n\n','{\"title\": \"Transaction Summary and Customer Segmentation Analysis\", \"engine\": 2}','2025-03-08 21:26:06','2025-03-09 09:52:42'),(15,'chart','','{\"data\": {\"source_type\": \"cell_above\", \"transformations\": {\"format\": {}}}, \"chart\": {\"type\": \"line\", \"x_axis\": {\"label\": \"\", \"col_idx\": 0}, \"y_axis\": {\"label\": \"\", \"series\": {}}}, \"title\": \"\", \"visual\": {}, \"collapsed\": false}','2025-03-09 08:34:46','2025-03-09 08:34:46'),(16,'chart','','{\"data\": {\"source_type\": \"cell_above\", \"transformations\": {\"format\": {}}}, \"chart\": {\"type\": \"line\", \"x_axis\": {\"label\": \"\", \"col_idx\": 0}, \"y_axis\": {\"label\": \"\", \"series\": {}}}, \"title\": \"\", \"visual\": {}, \"collapsed\": false}','2025-03-09 09:53:02','2025-03-09 09:53:02'),(17,'chart','','{\"data\": {\"source_type\": \"cell_above\", \"transformations\": {\"format\": {}}}, \"chart\": {\"type\": \"line\", \"x_axis\": {\"label\": \"\", \"col_idx\": 0}, \"y_axis\": {\"label\": \"\", \"series\": {}}}, \"title\": \"\", \"visual\": {}, \"collapsed\": false}','2025-03-09 09:53:08','2025-03-09 09:53:08');
